INSERT INTO `p1` VALUES (, '4', 'Chennai', 'p1', 'Hotel', 'Indian Restaurant', 'Liberty Park', '\r\nLiberty Park, since its inception in 1994, has laid great emphasis \r\non quality of service together with customer satisfaction.', '9, 1st Main Road, UI Colony,\r\nKodambakkam, Chennai, \r\nTamil Nadu 600024 ', '13.052801937462013', '80.22815707324298', '1');
