INSERT INTO `p2` VALUES (, '2', 'Chennai', 'p2', 'Shop', 'Mall', 'Skywalk', 'Ampa Skywalk, is a shopping mall in Chennai. With three floors of retail space, it has outlets for major clothing and apparel brands, a 7-screen multiplex, games zone and a food court serving multi-cuisine dishes.', 'No. 1, Nelson Manickam Road, Aminjikarai (627, Poonamalee High Road)\r\n\r\nChennai, TN 600029', '13.073714759904503', '80.22136572001727', '0');
INSERT INTO `p3` VALUES (, '1', 'Bangalore', 'p3', 'Shop', 'Mall', 'Mantri Square', 'Mantri Square is a shopping mall situated in the Malleswaram locality in Bangalore, India. With 924,000 sq ft GLA, it became the biggest mall in South India when it opened in 2010.', 'No 1, Sampige Road, Malleshwaram, Bangalore, Karnataka 560003', '12.999515107699862', '77.56906333564075', '1');
INSERT INTO `p4` VALUES (, '1', 'Chennai', 'p4', 'Hotel', 'Indian Restaurant', 'Sheraton Park Hotel', 'Earn bonus StarpointsÂ® & more for your check-ins when you connect your SPGÂ® & foursquare accounts. Visit spg.com/foursquare to view latest earning opportunities', 'TTK Road\r\n\r\nChennai, Tamil Nadu 600018', '13.029347371797101', '80.24962010978015', '0');
INSERT INTO `p4` VALUES (, '2', 'Chennai', 'p4', 'Shop', 'Mall', 'Express Avenue', 'Express Avenue is a shopping mall in Chennai promoted by Express Infrastructure, a subsidiary of The Indian Express Group. It is home to the largest gaming arcade in South India.', 'No. 2, Club House Rd., (Mount Rd.)\r\n\r\nChennai, Tamil Nadu 600002', '13.058739697331196', '80.26419523356708', '0');
INSERT INTO `p5` VALUES (, '1', 'Chennai', 'p5', 'Hotel', 'English Pub', 'The Residency Towers', 'Pool tables, darts and a huge 1946 Norton Classic bike hanging above the bar lend originality to the Bike and Barrel, situated within Chennai\'s Residency Towers hotel. ', 'Sir Thyagaraya Road\r\n\r\nTamil Nadu', '13.040641169099805', '80.24373266099246', '2');
